 "CORP. HERM.": ["Corpus Hermeticum", {"Fr. Vind": "Fragmenta Vindobonensia", "\u03a0\u03b5\u03c1\u1f76 \u03bd\u03bf\u1f75\u03c3\u03b5\u03c9\u03c2 \u03ba\u03b1\u1f76 \u03b1\u1f30\u03c3\u03b8\u1f75\u03c3\u03b5\u03c9\u03c2. [\u1f45\u03c4\u03b9 \u1f10\u03bd \u03bc\u1f79\u03bd\u1ff3 \u03c4\u1ff7 \u03b8\u03b5\u1ff7 \u03c4\u1f78": "\u03a0\u03b5\u03c1\u1f76 \u03bd\u03bf\u1f75\u03c3\u03b5\u03c9\u03c2 \u03ba\u03b1\u1f76 \u03b1\u1f30\u03c3\u03b8\u1f75\u03c3\u03b5\u03c9\u03c2. [\u1f45\u03c4\u03b9 \u1f10\u03bd \u03bc\u1f79\u03bd\u1ff3 \u03c4\u1ff7 \u03b8\u03b5\u1ff7 \u03c4\u1f78", "Asclepius (verba Graeca solum)": "Asclepius (verba Graeca solum)", "\u03a0\u03b5\u03c1\u1f76 \u03bd\u03bf\u1fe6 \u03ba\u03bf\u03b9\u03bd\u03bf\u1fe6 \u03c0\u03c1\u1f78\u03c2 \u03a4\u1f71\u03c4": "\u03a0\u03b5\u03c1\u1f76 \u03bd\u03bf\u1fe6 \u03ba\u03bf\u03b9\u03bd\u03bf\u1fe6 \u03c0\u03c1\u1f78\u03c2 \u03a4\u1f71\u03c4", "Fr": "Fragmenta", "Dialogus (sine titulo)": "Dialogus (sine titulo)", "\u1f18\u03ba \u03c4\u03bf\u1fe6 \u1f55\u03bc\u03bd\u03bf\u03c5 \u03c0\u03c1\u1f78\u03c2 \u03c4\u1f78\u03bd \u03c0\u03b1\u03bd\u03c4\u03bf\u03ba\u03c1\u1f71\u03c4\u03bf\u03c1\u03b1 (fragmentum)": "\u1f18\u03ba \u03c4\u03bf\u1fe6 \u1f55\u03bc\u03bd\u03bf\u03c5 \u03c0\u03c1\u1f78\u03c2 \u03c4\u1f78\u03bd \u03c0\u03b1\u03bd\u03c4\u03bf\u03ba\u03c1\u1f71\u03c4\u03bf\u03c1\u03b1 (fragmentum)", "\u03a0\u03c1\u1f78\u03c2 \u03a4\u1f70\u03c4 \u03c5\u1f31\u1f78\u03bd \u1f45\u03c4\u03b9 \u1f00\u03d5\u03b1\u03bd\u1f74\u03c2 \u03b8\u03b5\u1f78\u03c2 \u03d5\u03b1\u03bd\u03b5\u03c1\u1f7d\u03c4\u03b1\u03c4\u1f79\u03c2 \u1f10\u03c3\u03c4\u03b9\u03bd": "\u03a0\u03c1\u1f78\u03c2 \u03a4\u1f70\u03c4 \u03c5\u1f31\u1f78\u03bd \u1f45\u03c4\u03b9 \u1f00\u03d5\u03b1\u03bd\u1f74\u03c2 \u03b8\u03b5\u1f78\u03c2 \u03d5\u03b1\u03bd\u03b5\u03c1\u1f7d\u03c4\u03b1\u03c4\u1f79\u03c2 \u1f10\u03c3\u03c4\u03b9\u03bd", "\u1f4d\u03c4\u03b9 \u03bc\u1f73\u03b3\u03b9\u03c3\u03c4\u03bf\u03bd \u03ba\u03b1\u03ba\u1f78\u03bd \u1f10\u03bd \u1f00\u03bd\u03b8\u03c1\u1f7d\u03c0\u03bf\u03b9\u03c2 \u1f21 \u03c0\u03b5\u03c1\u1f76 \u03c4\u03bf\u1fe6 \u03b8\u03b5\u03bf\u1fe6": "\u1f4d\u03c4\u03b9 \u03bc\u1f73\u03b3\u03b9\u03c3\u03c4\u03bf\u03bd \u03ba\u03b1\u03ba\u1f78\u03bd \u1f10\u03bd \u1f00\u03bd\u03b8\u03c1\u1f7d\u03c0\u03bf\u03b9\u03c2 \u1f21 \u03c0\u03b5\u03c1\u1f76 \u03c4\u03bf\u1fe6 \u03b8\u03b5\u03bf\u1fe6", "\u1f4d\u03c1\u03bf\u03b9 \u1f08\u03c3\u03ba\u03bb\u03b7\u03c0\u03b9\u03bf\u1fe6 \u03c0\u03c1\u1f78\u03c2 \u1f0c\u03bc\u03bc\u03c9\u03bd\u03b1 \u03b2\u03b1\u03c3\u03b9\u03bb\u1f73\u03b1": "\u1f4d\u03c1\u03bf\u03b9 \u1f08\u03c3\u03ba\u03bb\u03b7\u03c0\u03b9\u03bf\u1fe6 \u03c0\u03c1\u1f78\u03c2 \u1f0c\u03bc\u03bc\u03c9\u03bd\u03b1 \u03b2\u03b1\u03c3\u03b9\u03bb\u1f73\u03b1", "\u1f4d\u03c4\u03b9 \u1f10\u03bd \u03bc\u1f79\u03bd\u1ff3 \u03c4\u1ff7 \u03b8\u03b5\u1ff7 \u03c4\u1f78 \u1f00\u03b3\u03b1\u03b8\u1f79\u03bd \u1f10\u03c3\u03c4\u03b9\u03bd, \u1f00\u03bb\u03bb\u03b1\u03c7\u1f79\u03b8\u03b9 \u03b4\u1f72": "\u1f4d\u03c4\u03b9 \u1f10\u03bd \u03bc\u1f79\u03bd\u1ff3 \u03c4\u1ff7 \u03b8\u03b5\u1ff7 \u03c4\u1f78 \u1f00\u03b3\u03b1\u03b8\u1f79\u03bd \u1f10\u03c3\u03c4\u03b9\u03bd, \u1f00\u03bb\u03bb\u03b1\u03c7\u1f79\u03b8\u03b9 \u03b4\u1f72", "\u03a0\u03b5\u03c1\u1f76 \u03c4\u1fc6\u03c2 \u1f51\u03c0\u1f78 \u03c4\u03bf\u1fe6 \u03c0\u1f71\u03b8\u03bf\u03c5\u03c2 \u03c4\u03bf\u1fe6 \u03c3\u1f7d\u03bc\u03b1\u03c4\u03bf\u03c2 \u1f10\u03bc\u03c0\u03bf\u03b4\u03b9\u03b6\u03bf\u03bc\u1f73\u03bd\u03b7\u03c2": "\u03a0\u03b5\u03c1\u1f76 \u03c4\u1fc6\u03c2 \u1f51\u03c0\u1f78 \u03c4\u03bf\u1fe6 \u03c0\u1f71\u03b8\u03bf\u03c5\u03c2 \u03c4\u03bf\u1fe6 \u03c3\u1f7d\u03bc\u03b1\u03c4\u03bf\u03c2 \u1f10\u03bc\u03c0\u03bf\u03b4\u03b9\u03b6\u03bf\u03bc\u1f73\u03bd\u03b7\u03c2", "Poimandres": "Poimandres", "Fragmenta varia (verba Graeca solum)": "Fragmenta varia (verba Graeca solum)", "Dialogus (sine titulo)_002": "Dialogus (sine titulo)", "\u03a0\u03c1\u1f78\u03c2 \u03a4\u1f70\u03c4 \u1f41 \u03ba\u03c1\u03b1\u03c4\u1f74\u03c1 \u1f22 \u03bc\u03bf\u03bd\u1f71\u03c2": "\u03a0\u03c1\u1f78\u03c2 \u03a4\u1f70\u03c4 \u1f41 \u03ba\u03c1\u03b1\u03c4\u1f74\u03c1 \u1f22 \u03bc\u03bf\u03bd\u1f71\u03c2", "Hieros logos": "Hieros logos", "Fr. Ox": "Fragmenta Oxoniensia", "\u1f08\u03c3\u03ba\u03bb\u03b7\u03c0\u03b9\u1ff7 \u03b5\u1f56 \u03d5\u03c1\u03bf\u03bd\u03b5\u1fd6\u03bd": "\u1f08\u03c3\u03ba\u03bb\u03b7\u03c0\u03b9\u1ff7 \u03b5\u1f56 \u03d5\u03c1\u03bf\u03bd\u03b5\u1fd6\u03bd", "\u1f4d\u03c4\u03b9 \u03bf\u1f50\u03b4\u1f72\u03bd \u03c4\u1ff6\u03bd \u1f44\u03bd\u03c4\u03c9\u03bd \u1f00\u03c0\u1f79\u03bb\u03bb\u03c5\u03c4\u03b1\u03b9, \u1f00\u03bb\u03bb\u1f70 \u03c4\u1f70\u03c2 \u03bc\u03b5\u03c4\u03b1\u03b2\u03bf\u03bb\u1f70\u03c2": "\u1f4d\u03c4\u03b9 \u03bf\u1f50\u03b4\u1f72\u03bd \u03c4\u1ff6\u03bd \u1f44\u03bd\u03c4\u03c9\u03bd \u1f00\u03c0\u1f79\u03bb\u03bb\u03c5\u03c4\u03b1\u03b9, \u1f00\u03bb\u03bb\u1f70 \u03c4\u1f70\u03c2 \u03bc\u03b5\u03c4\u03b1\u03b2\u03bf\u03bb\u1f70\u03c2", "Fr. Min": "Fragmenta Minora", "ad Amm": "ad Ammonem", "\u039d\u03bf\u1fe6\u03c2 \u03c0\u03c1\u1f78\u03c2 \u1f19\u03c1\u03bc\u1fc6\u03bd": "\u039d\u03bf\u1fe6\u03c2 \u03c0\u03c1\u1f78\u03c2 \u1f19\u03c1\u03bc\u1fc6\u03bd", "\u03a0\u03c1\u1f78\u03c2 \u03c4\u1f78\u03bd \u03c5\u1f31\u1f78\u03bd \u03a4\u1f70\u03c4 \u1f10\u03bd \u1f44\u03c1\u03b5\u03b9 \u03bb\u1f79\u03b3\u03bf\u03c2 \u1f00\u03c0\u1f79\u03ba\u03c1\u03c5\u03d5\u03bf\u03c2, \u03c0\u03b5\u03c1\u1f76": "\u03a0\u03c1\u1f78\u03c2 \u03c4\u1f78\u03bd \u03c5\u1f31\u1f78\u03bd \u03a4\u1f70\u03c4 \u1f10\u03bd \u1f44\u03c1\u03b5\u03b9 \u03bb\u1f79\u03b3\u03bf\u03c2 \u1f00\u03c0\u1f79\u03ba\u03c1\u03c5\u03d5\u03bf\u03c2, \u03c0\u03b5\u03c1\u1f76", "\u039a\u03bb\u03b5\u1f77\u03c2": "\u039a\u03bb\u03b5\u1f77\u03c2"}, ["", "", "", ""]],
